// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TokenContract {
    address public owner;
    uint256 public maxTxAmount;
    uint256 public maxWalletSize;
    bool public transferDelayEnabled;

    event MaxTxAmountUpdated(uint256 newMaxTxAmount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        _;
    }

    constructor() {
        owner = msg.sender;
        maxTxAmount = 0x041cdb40; // Example initial value
        maxWalletSize = 0x041cdb40; // Example initial value
        transferDelayEnabled = false;
    }

    function removeLimits() public onlyOwner {
        maxTxAmount = type(uint256).max;
        maxWalletSize = type(uint256).max;
        transferDelayEnabled = false;

        emit MaxTxAmountUpdated(maxTxAmount);
    }
}
```

### Explanation:
- **Owner Check**: The `onlyOwner` modifier is used to ensure that only the contract owner can call the `removeLimits` function.
- **State Variables**: `maxTxAmount`, `maxWalletSize`, and `transferDelayEnabled` are state variables that are updated in the `removeLimits` function.
- **Event**: An event `MaxTxAmountUpdated` is emitted when the `maxTxAmount` is updated.
- **Constructor**: Initializes the contract with the deployer as the owner and sets initial values for `maxTxAmount` and `maxWalletSize`.
- **Functionality**: The `removeLimits` function sets `maxTxAmount` and `maxWalletSize` to their maximum possible values and disables the transfer delay.

